import React from 'react';
import Card from './Card';

const Album = ({ album }) => {
  return (
    <div className="album">
      <h2>{album.name}</h2>
      <div className="album-page">
        {album.cards.map((card, index) => (
          <Card key={index} card={card} />
        ))}
      </div>
    </div>
  );
};

export default Album;
